import React from 'react'
import Card from './Card'
import AddCards from './AddCards'

export default function CardsList({ mesCards, handleAddCards }) {

    return (

        <div>
            <div>
                {mesCards.map(card => (
                    <Card
                        text={card.text}
                    />
                ))}
            </div>
            <AddCards handleAddCards={handleAddCards} />
        </div>
    )
}
